import axios, { AxiosResponse } from "axios";

const getNews = (): Promise<AxiosResponse> => {
  const requestUrl = "https://api.tvmaze.com/shows?page=1";
  console.log(requestUrl)
  return axios.get(requestUrl);
};
export default getNews;
